import React from 'react';
import projectList from '../../../utils/main/section-projects/projectList';

function CarouselBullets() {
  let count = 0;
  const bullets = projectList.map((item) => (
    <li key={item.index} className="bullet-item">
      <a href={item.id} className="bullet-link">
        <div className="bullet">
          {count++}
        </div>
      </a>
    </li>
  ));
  return (
    <ul className="bullet-list">
      {bullets}
    </ul>
  );
}

export default CarouselBullets;
